webpackJsonp([6],{271:function(n,p){n.exports="<blockquote>\n  <p>⌘（command）、⌥（option）、⇧（shift）、⇪（caps lock）、⌃（control）、↩（return）、⌅（enter）</p>\n</blockquote>\n<p>Command+M:最小化窗口</p>\n<p>Command+T: 在浏览器中打开新的选项卡</p>\n<p>Command+W: 关闭窗口</p>\n<p>Command+Q: 退出程序</p>\n<p>Command+Option+I 快捷键打开开发人员工具</p>\n<p>Command+Option+J 直接进入 JavaScript 控制台</p>\n<p>command+R： 刷新页面</p>\n<p>Command+~ 用于同一个应用程序的多窗口切换</p>\n<p>command+tab用于多应用程序的窗口切换</p>\n<p>^+option+space/^+space:切换输入法</p>\n<p>全屏截图：Command+Shift+3,    使用快捷键后会马上截获当前的全屏。保存到桌面上</p>\n<p>区域截图：Command+Shift +4,  保存到桌面</p>\n<pre><code>    Cmd+Ctrl+shift+4，保存截图到剪切板\n</code></pre>\n<p>程序窗口截图： Command+Shift+4+Space, 使用快捷键后会出现一个照相机的图标， 选择程序窗口，然后单击截图。</p>\n<p>共享目录：打开Finder,    command +K   打开共享目录 输入： smb://192.168.0.4/share</p>\n<p>HOME:command+&lt;</p>\n<p>end:command+&gt;</p>\n<p>锁屏： command＋option＋关机键</p>\n<p>https://ashleynolan.co.uk/blog/launching-sublime-from-the-terminal</p>"}});